import React, { useEffect } from 'react';
import Header from "../../dumb-components/Header"

import Slider from "react-slick";
import YouTube from 'react-youtube';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";


export default function Home() {
    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
      const opts = {
        height: '390',
        width: '640',
        playerVars: 'https://developers.google.com/youtube/player_parameters'
        ,
      };

    return (
        <>
            <Header />
            <div className="component-video-gallery container-holder">
                <h1 className="opacity-50 font-500">Concept Videos</h1>
                <h6 className="opacity-50 font-400 text-12">Select a number</h6>
                <Slider {...settings}>
                    <div>
                    <YouTube videoId="2g811Eo7K8U" opts={opts}/>;
                    </div>
                    <div>
                        <h3>2</h3>
                    </div>
                    <div>
                        <h3>3</h3>
                    </div>
                    <div>
                        <h3>4</h3>
                    </div>
                    <div>
                        <h3>5</h3>
                    </div>
                    <div>
                        <h3>6</h3>
                    </div>
                </Slider>
            </div>

        </>
    )
}
